Hot-to-trot Latina coed Melanie Rios is happy to help a fellow classmate brush up on his Spanish. And it doesn't hurt that she has a crush on him either. When Melanie gets to his place, she begins to teach him how to use his tongue to roll his R's. But before long Melanie has him using his tongue in much more imaginative ways..
